import React from 'react';

import Person from './Person/Person'

const people = (props) => {
            return this.props.persons.map( (person, index) => {
            return <Person
              key = {person.id} 
              click = {() => this.props.clicked(index)}
              name = {person.name} 
              age = {person.age}
              changed = {(event) => this.props.changed(event, person.id)}/>
        });
}

export default people;
